Wanneer Agent Neil Shaw ervoor uitkomt dat hij de moord op zijn vroegere mentor wou rechtvaardigen, begeeft hij zich op het 
spoor van verraad en dodelijke corruptie. Onder de bescherming van zijn vriend en senaatskandidaat, begint zijn missie om de 
zaken eens en voor altijd recht te zetten. Maar wanneer er steeds meer mensen dood opduiken, realiseert Shaw zich dat hij 
gebruikt wordt als lokaas.
